	protected void doGet(HttpServletRequest _request, HttpServletResponse _response) throws ServletException, IOException {
		request = _request;
		Responser response = new Responser(_response);
		
		if (request.getRequestURI().contains("htmleditor_iframe")) {
			
			boolean hasValue = new Requester(request).hasValue("basePath");
			String html = htmleditor_iframe.replace("${param.basePath}", hasValue ? request.getParameter("basePath") : "");
			response.outputHTML(html);
		
		} else if (request.getRequestURI().contains("captchaImg")) {
			response.setContentType("image/JPEG");
			Captcha.init(response, request.getSession());
		} else if (request.getRequestURI().contains("http_proxy")) {
			response.output(http_proxy());
		} else if (request.getRequestURI().contains("weather")) {
//			getWeather();
		} else if (request.getRequestURI().contains("ip_location")) {
			response.outputJSON(ip_location());
		} else if (request.getRequestURI().contains("sendMail")) {
//			sendMail(request, response);
		} else if (request.getRequestURI().contains("misc")) {
			String type = request.getParameter("type");
			if ("ip_owner".equals(type)) {

			} else if ("".equals(type)) {

			}
		} else if (request.getRequestURI().contains("remoteConsole")) {
			String msg = "";
			Map<String, String> requestMap = getAll();
			if (requestMap.size() > 0) {
				msg = StringUtil.HashJoin(requestMap, '&');
			} else {
				msg = "没有参数";
			}

			LOGGER.info("手机调试参数：" + msg);
			// 可能是 jsonp
			response.output(String.format("(function(){console.log('%s');})();", msg));
		} else if(request.getRequestURI().contains("under_construction")) {
			response.outputSimpleHTML(under_construction_img);
		} else {
			LOGGER.info("Do nothing!");
		}
	}

