	private String getIp_JSON() {
		return Get.GET(ip_location + IP.getIP(request));
	}

	/**
	 * https://www.ipip.net/
	 * http://int.dpool.sina.com.cn/iplookup/iplookup.php?format=js&ip=123.123.123.123
	 */
	private final static String ip_location = "http://int.dpool.sina.com.cn/iplookup/iplookup.php?format=js&ip=";
	
	/**
	 * 根据请求 ip 显示所在区域
	 */
	private String ip_location() {
		String json = getIp_JSON();
		return json.replace("var remote_ip_info = ", "").replaceAll(";$", "");
	}

	/**
	 * /common_service/http_proxy?url=http://panda.www.net.cn/cgi-bin/check.cgi&area_domain=doucube.com
	 */
	private String http_proxy() {
		String url = request.getParameter("url");
		String params = MapHelper.join(getAll("url"), "&"); // 不要 url 参数

		return Get.GET(url + '?' + params);
	}
	
	/**
	 * 获取客户端请求的参数和值 代替原生 getParameterMap() 
	 * getParameterMap() 返回 <String, String[]>，使用比较繁琐
	 * 
	 * @return 包含 Request 所有键值的 Map
	 */
	public Map<String, String> getAll() {
		Map<String, String> data = new HashMap<>();
		String key;
		Enumeration<String> enu = request.getParameterNames();

		while (enu.hasMoreElements()) {
			key = enu.nextElement();
			data.put(key, request.getParameter(key));
		}

		return data;
	}
	
	/**
	 * 获取客户端请求的参数和值，剔除不要的字段
	 * 
	 * @param ignoreField
	 *            忽略的字段
	 * @return 包含 Request 所有键值的 Map
	 */
	public Map<String, String> getAll(String ignoreField) {
		Map<String, String> map = getAll();
		if (ignoreField != null) map.remove(ignoreField);
		return map;
	}

	/**
	 * 获取客户端请求的参数和值，剔除不要的字段
	 * 
	 * @param isTypeCast
	 *            是否转换到 Java值
	 * @return 包含 Request 所有键值的 Map
	 */
	public Map<String, Object> getAll(boolean isTypeCast) {
		return MapHelper.asObject(getAll(), isTypeCast);
	}
	
	/**
	 * 获取客户端请求的参数和值，剔除不要的字段并转换到 Java值
	 * 
	 * @param isTypeCast
	 *            是否转换到 Java值
	 * @param ignoreField
	 *            忽略的字段
	 * @return 包含 Request 所有键值的 Map
	 */
	public Map<String, Object> getAll(boolean isTypeCast, String ignoreField) {
		return MapHelper.asObject(getAll(ignoreField), isTypeCast);
	}
	
